import React,{Component} from 'react';
import {
    HomeWidget
} from './style';

class Home extends Component{
    render(){
        return (
            <HomeWidget>
                <img src='https://ss0.bdstatic.com/94oJfD_bAAcT8t7mm9GUKT-xh_/timg?image&quality=100&size=b4000_4000&sec=1555643076&di=199f3d4c44a1822cc894d16927274f60&src=http://img.zcool.cn/community/013c865874d729a8012060c8dbe0e8.png@1280w_1l_2o_100sh.png' />
            </HomeWidget>
        )
    }
}   
export default Home;
